import React, { useState } from "react";
import axios from 'axios';
import './CreateEvent.css';  // Import custom CSS for styling

function CreateEvent() {
  const [eventData, setEventData] = useState({
    event_name: "",
    club_id: "",
    event_date: "",
    event_description: "",
    location: "",
    cover_photo: null, // for file
    video: null, // for file
  });

  const handleChange = (e) => {
    if (e.target.name === "cover_photo" || e.target.name === "video") {
      setEventData({ ...eventData, [e.target.name]: e.target.files[0] });
    } else {
      setEventData({ ...eventData, [e.target.name]: e.target.value });
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    const formData = new FormData();
    // Append event data to formData
    formData.append("event_name", eventData.event_name);
    formData.append("club_id", eventData.club_id);
    formData.append("event_date", eventData.event_date);
    formData.append("event_description", eventData.event_description);
    formData.append("location", eventData.location);

    // Append files to formData if they exist
    if (eventData.cover_photo) {
      formData.append("cover_photo", eventData.cover_photo);
    }
    if (eventData.video) {
      formData.append("video", eventData.video);
    }

    try {
      const response = await axios.post("http://localhost:8000/create-event", formData, {
        headers: {
          "Content-Type": "multipart/form-data",
          Authorization: `Bearer ${localStorage.getItem("token")}`, // Include token for authentication
        },
      });
      alert(response.data.message); // Show success message
    } catch (error) {
      console.error(error);
      alert(error.response?.data?.error || "Failed to create event");
    }
  };

  return (
    <div className="create-event-page">
      <div className="form-box">
        <h2>Create Event</h2>
        <form className="event-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="event_name">Event Name</label>
            <input
              id="event_name"
              name="event_name"
              type="text"
              placeholder="Event Name"
              value={eventData.event_name}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="club_id">Club ID</label>
            <input
              id="club_id"
              name="club_id"
              type="text"
              placeholder="Club ID"
              value={eventData.club_id}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="event_date">Event Date</label>
            <input
              id="event_date"
              name="event_date"
              type="date"
              value={eventData.event_date}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="event_description">Event Description</label>
            <textarea
              id="event_description"
              name="event_description"
              placeholder="Event Description"
              value={eventData.event_description}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="location">Location</label>
            <input
              id="location"
              name="location"
              type="text"
              placeholder="Event Location"
              value={eventData.location}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-group">
            <label htmlFor="cover_photo">Cover Photo</label>
            <input
              id="cover_photo"
              name="cover_photo"
              type="file"
              onChange={handleChange}
            />
          </div>
          <div className="form-group">
            <label htmlFor="video">Event Video</label>
            <input
              id="video"
              name="video"
              type="file"
              onChange={handleChange}
            />
          </div>
          <button type="submit" className="submit-btn">
            Create Event
          </button>
        </form>
      </div>
    </div>
  );
}

export default CreateEvent;
